import "./checkTokens.css";

import React from "react";
import Home from "../pages/home";
import Login from "../pages/login";

export default function Decision() {
    return (
        <body>
            {(localStorage.getItem("token"))? <Home/>: <Login/>}
        </body>
    );
}
